import React from "react";
import { Routes, Route, BrowserRouter } from "react-router-dom";
import Nav from "./components/Nav/Nav"; // افترض أن مكون Nav في مجلد components/Nav
import Home from "./components/Osaid"; // صفحة رئيسية
import About from "./components/Osaid"; // صفحة حول
import Contact from "./components/Osaid";
import Community from "./components/Osaid"; // صفحة اتصل بنا
import Login from "./components/Osaid"; // صفحة اتصل بنا
import Articles from "./components/Osaid"; // صفحة اتصل بنا
import Questions from "./components/Osaid"; // صفحة اتصل بنا

function App() {
  return (
    <BrowserRouter>
      <Nav />
      <Routes path>
  <Route path="/" element={<Home />} />
  <Route path="/about" element={<About />} />
  <Route path="/contact" element={<Contact />} />
  <Route path="/community" element={< Community />}/>
    <Route path="login" element={<Login />}/>
    <Route path="articles" element={<Articles />} />
    <Route path="questions" element={<Questions />} />
</Routes>
</BrowserRouter>
    
  );
}

export default App;
